import React from "react";
function Nav(props) {
  console.log("nav props", props);
  function toggleTheme(theme) {
    props.setMyTheme(theme === "light" ? "dark" : "light");
  }

  return (
    <div className="navbar">
      {/* <div className="aicon-menu"></div> */}
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("home");
        }}
      >
        {/* <svg className="logo" viewBox="0 0 56 56">
          <path d="M3,49H45L24,8ZM42,8V39.24L47,49h6V8Z" />
        </svg>
        <svg className="logo" viewBox="0 0 59 42">
          <path d="M4,38H43L23.5,4ZM43,4V31l4,7h8V4Z" />
        </svg> */}
        <svg
          className="logo"
          id="Layer_1"
          data-name="Layer 1"
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 76 56"
        >
          <title>ayi</title>
          <path
            className="cls-1"
            d="M30.52,11.95,50.51,46h-6.1l-4.68-8-.58-1H21.86l-.58,1-4.7,8H10.5l20-34.05m0-3.95L7,48H17.73L23,39H38l5.26,9H54L30.53,8Z"
          />
          <path d="M66,10V46H58V10h8m2-2H56V48H68V8Z" />
        </svg>

        <svg className="logo" viewBox="0 0 64 56">
          <title>letter</title>
          <path d="M59,10V46H51V10h8m2-2H49V48H61V8Z" />
          <path
            className="cls-1"
            d="M42.66,38.74,25.17,8,8.85,36.69h0L2.42,48l11.73,0,5.27-9.26h11.5L36.18,48H47.92l-5.26-9.25Zm1.78,7.2H37.33l-5.26-9.25H18.27L13,45.95H5.9l4.1-7.2h0l1.17-2.05h0l14-24.62,14,24.62h0l1.18,2.08h0Z"
          />
        </svg>
        {/* <svg className="logo" viewBox="0 0 56 56">
          <path d="M37.38,71A168.78,168.78,0,0,1,66,58.89c3.66-1.17,2.1-7-1.6-5.79a177.43,177.43,0,0,0-30,12.71c-3.4,1.83-.38,7,3,5.18Z" />
          <path
            className="cls-1"
            d="M36.74,11.79a16.18,16.18,0,0,0-12.29,5.8v0l0,0v5.52L34.3,47.81a17.55,17.55,0,0,0,2.44.19C47.24,48,53.5,39.89,53.5,29.9,53.5,18.94,46,11.79,36.74,11.79Z"
          />
          <path d="M19.92,18,31.24,44H8.61L19.92,18m0-10L2.5,48H37.35L19.92,8Z" />
        </svg> */}

        <svg className="logo" viewBox="0 0 56 56">
          <title>ai3</title>
          <path d="M5,44H40L22.5,14Zm3.48-2,14-24,14,24ZM41,14V44H51V14Zm8,28H43V16h6Z" />
        </svg>
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("dataViz");
        }}
      >
        DataViz
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("portfolio");
        }}
      >
        Portfolio
      </div>
      <div
        className="sunlight-nighttime "
        onClick={() => toggleTheme(props.myTheme)}
      >
        <span className="mr-1">Theme</span>
        {props.myTheme === "light" && <div className="aicon-sun-outline"></div>}
        {props.myTheme === "dark" && <div className="aicon-moon"></div>}
      </div>
    </div>
  );
}

export default Nav;
